import { useEffect, useState } from "react";
import { Outlet } from "react-router";
import "./App.css";
import "react-datepicker/dist/react-datepicker.css";
import Datepick from "./Components/Datepick";
import { backdateByDays } from "./libs/backdateByDays";

interface Props {
  copyright: string;
  date: string;
  explanation: string;
  hdurl: string;
  media_type: string;
  service_version: string;
  title: string;
  url: string;
}

function App() {
  const [images, setImages] = useState<Props[]>([]);
  const start_date = backdateByDays(6);
  const end_date = backdateByDays(0);

  // `https://api.nasa.gov/planetary/apod?api_key=DJnbcPU0nmH4c9DUejNgqxVpFh8wB61Jo8RiHeLc&start_date=${start_date}&end_date=${end_date}`
  useEffect(() => {
    let url = new URL("/planetary/apod", "https://api.nasa.gov");
    url.searchParams.append(
      "api_key",
      "DJnbcPU0nmH4c9DUejNgqxVpFh8wB61Jo8RiHeLc"
    );
    // url.searchParams.append("start_date", start_date);
    // url.searchParams.append("end_date", end_date);

    console.log("uroeeee", url);
    fetch(url.href)
      .then((response) => response)
      .then((e) => e.json())
      .then((e) => setImages(e));
  }, []);

  return (
    <div className="App">
      <section className="Main">
        <div className="Main-datepicker">
          <Datepick />
        </div>
        <div className="Main-display">
          <img className="Main-image" src={images[5]?.hdurl} />
        </div>
      </section>
      <Outlet />
    </div>
  );
}

export default App;
